module Day5 where

import Data.List
import Data.Char

inputData :: String
inputData = ""

opPol :: Char -> Char -> Bool
opPol c1 c2 = toLower c1 == toLower c2 && c1 /= c2

filterOpPol :: String -> String
filterOpPol [] = []
filterOpPol [x] = [x]
filterOpPol (x:y:xs)    | opPol x y = xs
                        | otherwise = x : filterOpPol (y:xs)

getFp :: String -> String                        
getFp xs    | length xs == length ys = xs
            | otherwise = getFp ys
            where ys = filterOpPol xs
                
filterChars :: String -> Char -> String
filterChars xs c = filter (\x -> toLower x /= c) xs

resultP1, resultP2 :: Int
resultP1 = (length . getFp) inputData
resultP2 = minimum $ map (length . getFp . filterChars (getFp inputData)) ['a' .. 'z']                        
